def project = testRunner.testCase.testSuite.project
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def TotalTestCases = testRunner.testCase.testSuite.getTestCases().size();	
testRunner.runTestStepByName( "VALID_VALUES")
def listOfValidatorResponse = groovyUtils.getXmlHolder( "VALID_VALUES#Response" )
int nbrLower_actor = 0;
int nbrLower_profil = 0;
int nbrLower_profilOp = 0;

def actor = listOfValidatorResponse.getNodeValue('//*:actorIntegrationProfile[1]//*:actor//*:keyword');
def profile = listOfValidatorResponse.getNodeValue('//*:actorIntegrationProfile[1]//*:integrationProfile//*:keyword');
def profileOption = listOfValidatorResponse.getNodeValue('//*:integrationProfileOption[1]//*:keyword');

def actors = listOfValidatorResponse.getNodeValues('//*:actorIntegrationProfile//*:actor//*:keyword');
def profiles = listOfValidatorResponse.getNodeValues('//*:actorIntegrationProfile//*:integrationProfile//*:keyword');
def profilesOption = listOfValidatorResponse.getNodeValues('//*:integrationProfileOption//*:keyword'); 

testRunner.testCase.testSuite.setPropertyValue("actor_keyword", actor )
testRunner.testCase.testSuite.setPropertyValue("profile_keyword", profile)
testRunner.testCase.testSuite.setPropertyValue("profileOption_keyword", profileOption)


//get Actor
for (Actor in actors) {
	if(Actor =~ '[a-z]{1}'){
		testRunner.testCase.testSuite.setPropertyValue("actor_keyword_lower", Actor)	
		nbrLower_actor = nbrLower_actor + 1;	
	}
}

//get Profile
for (Profile in profiles) {
	if(Profile =~ '[a-z]{1}'){
		testRunner.testCase.testSuite.setPropertyValue("profile_keyword_lower", Profile)	
		nbrLower_profil = nbrLower_profil + 1;	
	}
}

//get Profile Option
for (ProfileOp in profilesOption) {
	if(ProfileOp =~ '[a-z]{1}'){
		testRunner.testCase.testSuite.setPropertyValue("profileOption_keyword_lower", ProfileOp)	
		nbrLower_profilOp = nbrLower_profilOp + 1;	
	}
}


//disable tests case if doesnt exist
for(testCaseCounter in (0..TotalTestCases-1)){  
	def TestCaseName =testRunner.testCase.testSuite.getTestCaseAt(testCaseCounter).name	
		if (TestCaseName.contains('lower') && TestCaseName.contains('Actor') && nbrLower_actor == 0 ){
			testRunner.testCase.testSuite.getTestCaseByName(TestCaseName).setDisabled(true)
		}else {
			testRunner.testCase.testSuite.getTestCaseByName(TestCaseName).setDisabled(false)
		}
}

//disable tests case if doesnt exist
for(testCaseCounter in (0..TotalTestCases-1)){  
	def TestCaseName = testRunner.testCase.testSuite.getTestCaseAt(testCaseCounter).name	
		if (TestCaseName.contains('lower') && TestCaseName.contains('Profile') && nbrLower_profil == 0  && !TestCaseName.contains('ProfileOpt')){
			testRunner.testCase.testSuite.getTestCaseByName(TestCaseName).setDisabled(true)
		}
}

//disable tests case if doesnt exist
for(testCaseCounter in (0..TotalTestCases-1)){  
	def TestCaseName = testRunner.testCase.testSuite.getTestCaseAt(testCaseCounter).name	
		if (TestCaseName.contains('lower') && TestCaseName.contains('ProfileOpt') && nbrLower_profilOp == 0 ){
			testRunner.testCase.testSuite.getTestCaseByName(TestCaseName).setDisabled(true)
		}
}

if(null == actor ){
	for(testCaseCounter in (0..TotalTestCases-1)){  
	def TestCaseName = testRunner.testCase.testSuite.getTestCaseAt(testCaseCounter).name
	if (!TestCaseName.contains('getAllAIPO')){	
		testRunner.testCase.testSuite.getTestCaseByName(TestCaseName).setDisabled(true)	
	}
   }
}

